import React from 'react';
import { Form, Button } from 'react-bootstrap';
import './contactostyle.css';
import MapaImg from '../../Components/Images/MapaImg.png';

function Contacto() {
	return (
		<div class="container">
			<div class="CONTACTFORM">
				<Form>
					<Form.Group className="mb-3" controlId="formBasicName">
						<Form.Label>Nombre</Form.Label>
						<Form.Control type="className" placeholder="Nombre" />

						<Form.Label>Email</Form.Label>
						<Form.Control type="email" placeholder="Email" />
					</Form.Group>

					<Button variant="primary" type="submit">
						Enviar
					</Button>
				</Form>
			</div>
			<div class="MAP">
				<img alt="somevalue" className="mapImg" src={MapaImg} />
			</div>
			<div class="CONTACTEXT">
				<h3>Dirección</h3>
				<p> Calle Montes Urales 425 Lomas de Chapultepec, Miguel Hidalgo, 11000 Ciudad de México, CDMX</p>
				<h3>Contacto</h3>
				<p> Mail: contacto@procapital.com.mx Telefono: 55.23.30.36.69</p>
			</div>
		</div>
	);
}

export default Contacto;
